description:
21st Century Houses offers a bumper selection of outstanding contemporary designs in gorgeous, glossy color spreads. From modest to massive and everything in between, all the houses feature the latest trends in building and interior design and provide a revealing glimpse of what it's like to live in some of the most spectacular houses in the world. Locations include the United States, the United Kingdom, India, Germany, Italy, Australia, New Zealand, Brazil, Norway, Hong Kong, Singapore, Indonesia, Netherlands, Japan, the Bahamas, Mexico, Canada, Peru, Portugal, Switzerland, Spain, United Arab Emirates, Slovenia, Argentina, South Africa, Austria, Malaysia, and more. Features 150 of the world's most prominent architects, including US architects Swatt | Miers, Marmol Radziner, OSKA, LPA Inc, and Moore Ruble Yudell; European architects Jarmund Vigsnaes, Paul de Ruiter, Antonino Cardillo, Marc Kohler Architects, Damiliano Studio, and K-M Architects; and South American architects Marcio Kogan, Una Arquitectos, FGMF, BAK Arquitectos, and Artadi Arquitectos.

21st Century Houses - 150 of the World's Best
Book Language: English 
Pages: 300
